const TaskPage = () => {
    const headerButtons = [`logout`];
    return (
        <div className={style['task-page']}>
            <Menu></Menu>
            <div className={style['task-page-header']}>
                <h1>Hschool</h1>
                
                <HeaderItems >

                </HeaderItems>
               <div className={style['task-page-main']}>
                <TaskCounter></TaskCounter>
                <ToDo></ToDo>
                <TasksShedule></TasksShedule></div>
                </div>
        </div>
    );
};

